import {RightSide} from '../MyComponets/RightSide';
import {LeftSide} from '../MyComponets/LeftSide';

export const Content = () => {
    return (
        <div>
            <div className="container">
            <LeftSide/>
            <RightSide/>
            </div>
        </div>
    )
}
